import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div class="quiz-container">
      <h1>How do you like front end?</h1>
      <label class="label">How do you like front end?</label>
      <input type="range" class="range"></input>
      <label class="label">what is your favourite front end topic?</label>
      <input type="text" class="input"></input>
    </div>
  );
}

export default App;
